import React from "react";
import EditList_ul from "../EditList_ul";
import "./Frame2500.css";

function Frame2500(props) {
  const { editList_ulProps, className } = props;

  return (
    <div className={`frame-2500 ${className || ""}`}>
      <EditList_ul editList_Ul={editList_ulProps.editList_Ul} className="arrow-shortright2" />
    </div>
  );
}

export default Frame2500;
